import { ICard } from '@flashcards/core'

interface CardDataConstructorParams {
  id: string
  question: string
  answer: string
}

class CardData implements ICard {
  private _id: string
  private _question: string
  private _answer: string

  constructor({ id, question, answer }: CardDataConstructorParams) {
    this._id = id
    this._question = question
    this._answer = answer
  }

  get id() {
    return this._id
  }

  get question() {
    return this._question
  }

  get answer() {
    return this._answer
  }
}

export { CardData }
